import base64
import gzip

s1 = ""

s2 = ""

data1 = base64.b64decode(s1)
data2 = base64.b64decode(s2)

print("Length data1:", len(data1))
print("Length data2:", len(data2))
print("First 32 bytes data1:", data1[:32].hex())
print("First 32 bytes data2:", data2[:32].hex())

try:
    decompressed1 = gzip.decompress(data1)
    print("Gzip data1 success, length:", len(decompressed1))
    print(decompressed1[:500])  # first part if text
except Exception as e:
    print("Gzip data1 error:", str(e))

try:
    decompressed2 = gzip.decompress(data2)
    print("Gzip data2 success, length:", len(decompressed2))
    print(decompressed2[:500])
except Exception as e:
    print("Gzip data2 error:", str(e))